create table coach
(
    nickname     varchar,
    coach_id     integer not null
        constraint coach_pk
            primary key,
    country_code varchar,
    wikidata_id  varchar,
    coach_name   varchar,
    similarity   real
);

alter table coach
    owner to postgres;

create index coach_coach_id_idx
    on coach (coach_id);

create index coach_similarity_idx
    on coach (similarity);

create unique index coach_wikidata_id_uindex
    on coach (wikidata_id);

grant select on coach to inode_readonly;

